public class InnerDistributionConfigurationDistributionFactory(Action<Humidifier.ImageBuilder.DistributionConfigurationTypes.Distribution> factoryAction = null) : SubResourceFactory<Humidifier.ImageBuilder.DistributionConfigurationTypes.Distribution>
{

    internal InnerDistributionConfigurationAmiDistributionConfigurationFactory AmiDistributionConfigurationFactory { get; set; }

    internal InnerDistributionConfigurationContainerDistributionConfigurationFactory ContainerDistributionConfigurationFactory { get; set; }

    protected override Humidifier.ImageBuilder.DistributionConfigurationTypes.Distribution Create()
    {
        var distributionResult = CreateDistribution();
        factoryAction?.Invoke(distributionResult);

        return distributionResult;
    }

    private Humidifier.ImageBuilder.DistributionConfigurationTypes.Distribution CreateDistribution()
    {
        var distributionResult = new Humidifier.ImageBuilder.DistributionConfigurationTypes.Distribution();

        return distributionResult;
    }
    public override void CreateChildren(Humidifier.ImageBuilder.DistributionConfigurationTypes.Distribution result)
    {
        base.CreateChildren(result);

        result.AmiDistributionConfiguration ??= AmiDistributionConfigurationFactory?.Build();
        result.ContainerDistributionConfiguration ??= ContainerDistributionConfigurationFactory?.Build();
    }

} // End Of Class

